const Error = () => {
    return (
        <div style={{ backgroundImage: `url(${ErrorPic})`,
        backgroundSize:'cover',
         width: '100%', 
         height: '800px',
         display:'flex',
         justifyContent:'center',
         alignItems:'center' }}>
            <NavLink to="/"><button className="button-home">Go Home</button></NavLink>
        </div>);
}
export default Error;
